const AesJson={
/**
     * Encripte une valeur quelconque
     * @param {*} value
     * @param {string} password
     * @return {string}
     */
encrypt:function(t,r){return CryptoJS.AES.encrypt(JSON.stringify(t),r,{format:AesJson}).toString()},
/**
     * Decripte une valeur préalablement encriptée
     * @param {string} jsonStr
     * @param {string} password
     * @return {*}
     */
decrypt:function(t,r){return JSON.parse(CryptoJS.AES.decrypt(t,r,{format:AesJson}).toString(CryptoJS.enc.Utf8))},
/**
     * Stringifie une connée cryptoJS
     * @param {Object} cipherParams
     * @return {string}
     */
stringify:function(t){var r={ct:t.ciphertext.toString(CryptoJS.enc.Base64)};return t.iv&&(r.iv=t.iv.toString()),t.salt&&(r.s=t.salt.toString()),JSON.stringify(r).replace(/\s/g,"")},
/**
     * Parse une donnée cryptoJS
     * @param {string} jsonStr
     * @return {*}
     */
parse:function(t){var t=JSON.parse(t),r=CryptoJS.lib.CipherParams.create({ciphertext:CryptoJS.enc.Base64.parse(t.ct)});return t.iv&&(r.iv=CryptoJS.enc.Hex.parse(t.iv)),t.s&&(r.salt=CryptoJS.enc.Hex.parse(t.s)),r}};